import org.apache.spark.sql.expressions.Window;
import org.apache.spark.sql.types.TimestampType;
// import org.apache.spark.sql.expressions.Window

//Get the bus_parent.csv into a dataframe 
var bus_parent_df = spark.read.option("header", "true").option("ignoreLeadingWhiteSpace",true).csv("gs://rdx-cmu-2020-dataset/bus_parent.csv");
bus_parent_df = bus_parent_df.select(
            bus_parent_df.col("PARENT_ID").as("PARENT_BUS_ID"),
            bus_parent_df.col("BUS_ID").as("HIER_BUS_ID")
    );
bus_parent_df.show();

//Get the customer.csv into a dataframe 
var customer_df = spark.read.option("header", "true").option("ignoreLeadingWhiteSpace",true).csv("gs://rdx-cmu-2020-dataset/customer.csv");
customer_df = customer_df.select(
            customer_df.col("RECONCILIATION_ID"),
            customer_df.col("BUS_ID").as("BUS_ID")
    );
customer_df.show();

//Get the device.csv into a dataframe 
var device_df = spark.read.option("header", "true").option("ignoreLeadingWhiteSpace",true).csv("gs://rdx-cmu-2020-dataset/device.csv");
device_df = device_df.select(
            device_df.col("TARGET_ID").as("DEVICE_TARGET_ID"),
            device_df.col("RECON_ID")
    )
device_df.show();

//Get the device_location.csv into a dataframe 
var device_location_df = spark.read.option("header", "true").option("ignoreLeadingWhiteSpace",true).csv("gs://rdx-cmu-2020-dataset/device_location.csv");
device_location_df = device_location_df.select(
    col("BUS_ID").as("BUS_ID_DEV"),
    col("DEVICE_TYPE"),
    col("OPERATING_SYSTEM"),
    col("RECONCILIATION_ID"),
    col("SITE"),
    col("TYPE_NAME"),
    col("IS_VIRTUAL")
    );
device_location_df.show();

//Get the parent.csv into a dataframe 
var parent_df = spark.read.option("header", "true").option("ignoreLeadingWhiteSpace",true).csv("gs://rdx-cmu-2020-dataset/parent.csv");

parent_df = parent_df.select(
            parent_df.col("PARENT_ID").as("PARENT_TARGET_ID"),
            parent_df.col("TARGET_ID").as("CHILD_TARGET_ID")
    );

//Get the type.csv into a dataframe 
var type_df = spark.read.option("header", "true").option("ignoreLeadingWhiteSpace",true).csv("gs://rdx-cmu-2020-dataset/type.csv");

type_df = type_df.select(
            type_df.col("TARGET_ID").as("MONITOR_ID"),
            type_df.col("TYPE").as("MONITOR_DESC")
    );

//Get the event_log.csv into a dataframe 
var event_log_df = spark.read.option("header", "true").option("ignoreLeadingWhiteSpace",true).csv("gs://rdx-cmu-2020-dataset/event.log.20190902031144_20000.csv");
event_log_df = event_log_df.filter("policy_type == 'T'" ).filter("metric_name != 'Started'");
// event_log_df.count();
event_log_df.show();

// get top customers from top_clients.csv
var top_clients_df = spark.read.option("header", "true").option("ignoreLeadingWhiteSpace",true).csv("gs://rdx-cmu-2020-dataset/top_clients.csv");
top_clients_df.show();

// Get EventCode and an associated intger mapping
var event_code_mapped = event_log_df.select("event_code").distinct();
event_code_mapped = event_code_mapped.withColumn("event_code_id", row_number().over(Window.orderBy("event_code")));
event_code_mapped = event_code_mapped.select(
         event_code_mapped.col("event_code_id"),
       event_code_mapped.col("event_code").as("mapping_event_code")
    )

regexp_replace(event_code_mapped("mapping_event_code"),"\\s+"," ");

var device_event_log = event_log_df.join(device_df, event_log_df.col("TARGET_ID") === device_df.col("DEVICE_TARGET_ID"), "inner")
                            .drop("DEVICE_TARGET_ID");
device_event_log.count();// : 47
device_event_log.show();

var cust_device_event_log = device_event_log
    .join(customer_df, device_event_log.col("RECON_ID") === customer_df.col("RECONCILIATION_ID"), "inner").drop("RECONCILIATION_ID");
//  cust_device_event_log.count(); // 47
cust_device_event_log.show();

var cust_detail_device_event_log = cust_device_event_log
    .join(bus_parent_df, cust_device_event_log.col("BUS_ID") === bus_parent_df.col("HIER_BUS_ID"), "left_outer").drop("HIER_BUS_ID");
cust_detail_device_event_log.show();

var top_cust_detail_device_event_log = 
cust_detail_device_event_log.join(top_clients_df, cust_detail_device_event_log("BUS_ID") === top_clients_df("NEW_BUS_ID") || cust_detail_device_event_log("PARENT_BUS_ID") === top_clients_df("NEW_BUS_ID"), "inner").drop("CUMULATIVE_PERCENT", "RANK", "PERCENT"); 

top_cust_detail_device_event_log.show();

// S0 join event_log and device based on target id : OK
