var incident_df = spark.read.option("header", "true").option("ignoreLeadingWhiteSpace",true).csv("gs://rdx-cmu-2020-dataset/incidents.csv");
incident_df = incident_df.select(
            incident_df.col("incident_id").as("INCIDENT_ID"),
            incident_df.col("submit_date").as("SUBMIT_DATE"),
            incident_df.col("bus_id").as("BUS_ID"),
            incident_df.col("event_code").as("EVENT_CODE"),
            incident_df.col("submitter").as("SUBMITTER")
    );
incident_df.show();

//Get the incident_device.csv into a dataframe 
var incident_device_df = spark.read.option("header", "true").option("ignoreLeadingWhiteSpace",true).csv("gs://rdx-cmu-2020-dataset/incident-device.csv");
incident_device_df = incident_device_df.select(
            incident_device_df.col("incident_id").as("INCIDENT_DEV_ID"),
            incident_device_df.col("recon_id").as("RECON_ID")
    );
